pragma solidity ^0.5.0;

contract PensionFund {
    struct Employee {
        uint256 employeeId;
        uint256 startDate;
        uint256 retirementAge;
        uint256 pensionAmount;
        bool fundReleased;
    }

    mapping(address => Employee) public employees;
    uint256 public employeeCount;

    event FundDeposited(address indexed employeeAddress, uint256 amount);
    event FundReleased(address indexed employeeAddress, uint256 amount);

    function addEmployee(
        uint256 _employeeId,
        uint256 _startDate,
        uint256 _retirementAge,
        uint256 _pensionAmount
    ) public {
        require(
            employees[msg.sender].employeeId == 0,
            "Employee already registered"
        );
        employees[msg.sender] = Employee(
            _employeeId,
            _startDate,
            _retirementAge,
            _pensionAmount,
            false
        );
        employeeCount++;
    }

    function depositFund() public payable {
        require(
            employees[msg.sender].employeeId != 0,
            "Employee not registered"
        );
        employees[msg.sender].pensionAmount += msg.value;
        emit FundDeposited(msg.sender, msg.value);
    }

    function releaseFund() public {
        Employee storage employee = employees[msg.sender];
        require(employee.employeeId != 0, "Employee not registered");
        require(!employee.fundReleased, "Fund already released");

        uint256 currentTime = now;
        uint256 retirementTime = employee.startDate + (employee.retirementAge * 365 days);

        require(currentTime >= retirementTime, "Not eligible for retirement yet");

        employee.fundReleased = true;
        msg.sender.transfer(employee.pensionAmount);
        emit FundReleased(msg.sender, employee.pensionAmount);
    }
}
